                    ap_sync_reg_entry_proc_U0_ap_ready <= ap_sync_entry_proc_U0_ap_ready;
                end if; 
            end if;
        end if;
    end process;


    ap_sync_reg_readinput_U0_ap_ready_assign_proc : process(ap_clk)
    begin
        if (ap_clk'event and ap_clk =  '1') then
            if (ap_rst_n_inv = '1') then
                ap_sync_reg_readinput_U0_ap_ready <= ap_const_logic_0;
            else
                if (((ap_sync_ready and ap_start) = ap_const_logic_1)) then 
                    ap_sync_reg_readinput_U0_ap_ready <= ap_const_logic_0;
                else 
                    ap_sync_reg_readinput_U0_ap_ready <= ap_sync_readinput_U0_ap_ready;
                end if; 
            end if;
        end if;
    end process;

    ap_done <= s2mm_rewind_U0_ap_done;
    ap_idle <= (s2mm_rewind_U0_ap_idle and readinput_U0_ap_idle and (iqout_c_channel_empty_n xor ap_const_logic_1) and entry_proc_U0_ap_idle);
    ap_ready <= ap_sync_ready;

    ap_rst_n_inv_assign_proc : process(ap_rst_n)
    begin
                ap_rst_n_inv <= not(ap_rst_n);
    end process;

    ap_sync_entry_proc_U0_ap_ready <= (entry_proc_U0_ap_ready or ap_sync_reg_entry_proc_U0_ap_ready);
    ap_sync_readinput_U0_ap_ready <= (readinput_U0_ap_ready or ap_sync_reg_readinput_U0_ap_ready);
    ap_sync_ready <= (ap_sync_readinput_U0_ap_ready and ap_sync_entry_proc_U0_ap_ready);
    entry_proc_U0_ap_continue <= iqout_c_channel_full_n;
    entry_proc_U0_ap_start <= ((ap_sync_reg_entry_proc_U0_ap_ready xor ap_const_logic_1) and ap_start);
    readinput_U0_ap_continue <= ap_const_logic_1;
    readinput_U0_ap_start <= ((ap_sync_reg_readinput_U0_ap_ready xor ap_const_logic_1) and ap_start);
    s2mm_rewind_U0_ap_continue <= ap_const_logic_1;
    s2mm_rewind_U0_ap_start <= iqout_c_channel_empty_n;
    stream_TREADY <= readinput_U0_stream_TREADY;
end behav;
